import { createContext } from "react";
import { stat } from "fs";

export const Store = createContext("");

const reducer = (state, action) => {
	switch (action.type) {
		case "change":
			return action;
		default:
			return state;
	}
};

export const ContextWrapper = ({ children }) => {
	return <Store.Provider value="James">{children}</Store.Provider>;
};
